import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the view toggle buttons appear, we first need to perform a search.
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill('electronics');
    await page.locator('.search-btn').first().click();

    // Wait for search results and the view toggle buttons to be visible
    await page.waitForSelector('button[title="List View"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results_grid_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results_grid_view.png'));

    // Find and click the "List View" button
    const listViewButton = page.locator('button[title="List View"]');
    await listViewButton.click();

    // Wait for the product container to switch to list view mode
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view_mode.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view_mode.png'));

    // Extract data to verify the view switch
    const productContainerClass = await page.locator('.products-list').getAttribute('class');
    const isButtonActive = await listViewButton.getAttribute('class');

    return {
      success: true,
      action: "Switched product view from grid to list mode.",
      extractedData: {
        productContainerClass: productContainerClass,
        isListViewButtonActive: isButtonActive.includes('active')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
